                .fontColor(this.accountType === 2 ? $r('app.color.main_color') : $r('app.color.deep_gray'))
                .backgroundColor(this.accountType === 2 ? $r('app.color.button_active_bgc') : $r('app.color.button_bgc'))
                .onClick(() => this.accountType = 2)
              Button('支出')
