          .height($r('app.float.component_size_SP'))
          .padding({ left: $r('app.float.edge_size_M'), right: $r('app.float.edge_size_M') })
          .margin({ top: $r('app.float.edge_size_S'), bottom: $r('app.float.edge_size_S') })

          DateSelectComponent({
            beginDate: $beginDate,
