                          .flexGrow(CommonConstants.FULL_SIZE)
                      } else {
                        Row() {
                          Toggle({ type: ToggleType.Checkbox })
                            .onChange((isOn) => {
                              if (isOn) {
                                this.deleteList.push(account);
                              } else {
                                let index = this.deleteList.indexOf(account);
                                this.deleteList.splice(index, 1);
                              }
